import React from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './NavBar/NavBar'
import MainContent from "./MainContent"
import Footer from './Footer'
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <NavBar />
      <MainContent />
      <Footer />
    </div>
  );
}

export default App;
